            <NavLink to="/cups" style={{ color: "white", margin: '0 20px' }}>Кружки</NavLink>
            <NavLink to="/t-shirts" style={{ color: "white", margin: '0 20px' }}>Футболки</NavLink>
          </Typography>
          <Typography variant='h6' style={{ float: 'right' }}>
            <FormDialog />
          </Typography>
        </Toolbar>
      </AppBar>
      <Toolbar />
    </div>
    // <nav>
    // <div className="nav-wrapper blue darken-1" style={{ padding: '0 2rem' }}>
